import history from "owp/history.js";
import React, {Component} from 'react';
import {OwpPageCarded, OwpToolbar,OwpMessage} from "owp/wrapper";
import Button from "@material-ui/core/Button/index";
import FuseHighlight from "owp/@fuse/components/FuseHighlight/FuseHighlight";

class Page extends Component {

    fun = () => {
        OwpMessage({
            message     : 'success',//text or html
            variant: 'success'//success error info warning null
        });
    }
    fun2 = () => {
        history.push({
            pathname: '/'
        });
    }

    render()
    {
        return (
            <React.Fragment>
                <OwpPageCarded
                    contentToolbar={
                        <OwpToolbar
                            title={"OwpMessage 예제"}
                        />
                    }
                    content={
                        <React.Fragment>
                            <FuseHighlight component="pre" className="language-js">{`
fun = () => {
    OwpMessage({
        message     : 'success',//text or html
        variant: 'success'//success error info warning null
    });
}

<Button variant="outlined" onClick={() => OwpMessage({
    message     : 'success',//text or html
    variant: 'success'//success error info warning null
})} >success</Button>
<Button variant="outlined" onClick={() => OwpMessage({
    message     : 'error',//text or html
    variant: 'error'//success error info warning null
})} >error</Button>
<Button variant="outlined" onClick={() => OwpMessage({
    message     : 'info',//text or html
    variant: 'info'//success error info warning null
})} >info</Button>
<Button variant="outlined" onClick={() => OwpMessage({
    message     : 'warning',//text or html
    variant: 'warning'//success error info warning null
})} >warning</Button>
<Button variant="outlined" onClick={this.fun} >함수호출</Button>
                                `}
                            </FuseHighlight>


                            <OwpToolbar
                                title={"OwpTabs 예제"}
                            />

                            <Button variant="outlined" onClick={() => OwpMessage({
                                message     : 'success',//text or html
                                variant: 'success'//success error info warning null
                            })} >success</Button>
                            <Button variant="outlined" onClick={() => OwpMessage({
                                message     : 'error',//text or html
                                variant: 'error'//success error info warning null
                            })} >error</Button>
                            <Button variant="outlined" onClick={() => OwpMessage({
                                message     : 'info',//text or html
                                variant: 'info'//success error info warning null
                            })} >info</Button>
                            <Button variant="outlined" onClick={() => OwpMessage({
                                message     : 'warning',//text or html
                                variant: 'warning'//success error info warning null
                            })} >warning</Button>
                            <Button variant="outlined" onClick={this.fun} >함수호출</Button>
                            <Button variant="outlined" onClick={this.fun2} >GO</Button>
                        </React.Fragment>

                    }innerScroll
                />
            </React.Fragment>
        )
    };
}

export default Page;
